On: BBC 1 HD (101)    
Date: Saturday 22nd November 2014 

Gary Lineker presents highlights from all of the day's seven Premier League fixtures, including Arsenal and Manchester United. It will be the first time Manchester United manager Louis van Gaal has faced Arsene Wenger in the Premier League and he will be hoping to extend his side's unbeaten run at the Emirates, with United's last defeat away to Arsenal coming in May 2011. Title hopefuls Chelsea host a West Brom side that took crucial points off them last season. Elsewhere, champions Manchester City host Swansea, West Ham travel to Everton, Leicester take on Sunderland, Newcastle are at home to QPR and Burnley are away to Stoke.


